import React, { useState } from "react";

const Settings = () => {
    const [accountInfo, setAccountInfo] = useState({
        username: "CurrentUsername",
        email: "parent@example.com",
        phone: "123-456-7890",
        password: "",
    });

    const [childInfo, setChildInfo] = useState({
        childName: "Child's Name",
        childAge: 5,
    });

    const [notificationSettings, setNotificationSettings] = useState("email");
    const [securitySettings, setSecuritySettings] = useState("enabled");
    const [confirmationMessage, setConfirmationMessage] = useState("");

    // Handle changes in account form
    const handleAccountChange = (e) => {
        const { name, value } = e.target;
        setAccountInfo((prev) => ({ ...prev, [name]: value }));
    };

    // Handle changes in child form
    const handleChildChange = (e) => {
        const { name, value } = e.target;
        setChildInfo((prev) => ({ ...prev, [name]: value }));
    };

    // Handle changes in notification settings
    const handleNotificationChange = (e) => {
        setNotificationSettings(e.target.value);
    };

    // Handle changes in security settings
    const handleSecurityChange = (e) => {
        setSecuritySettings(e.target.value);
    };

    // Handle form submission
    const handleSubmit = (e) => {
        e.preventDefault();

        // Process or save the data as needed
        const data = {
            account: accountInfo,
            child: childInfo,
            notifications: notificationSettings,
            security: securitySettings,
        };

        console.log(data); // Log data or send it to a server

        // Show confirmation message
        setConfirmationMessage("Your changes have been saved!");
    };

    return (
        <div class="settings-page" id="settings">
            <h1>Parent Settings</h1>
            <section class="settings-section">
                <h2>Account Information</h2>
                <form id="account-info-form">
                    <div class="setting-group">
                        <label for="username">Username:</label>
                        <input
                            type="text"
                            id="username"
                            name="username"
                            value="CurrentUsername"
                        />
                    </div>
                    <div class="setting-group">
                        <label for="email">Email Address:</label>
                        <input
                            type="email"
                            id="email"
                            name="email"
                            value="parent@example.com"
                        />
                    </div>
                    <div class="setting-group">
                        <label for="phone">Phone Number:</label>
                        <input
                            type="tel"
                            id="phone"
                            name="phone"
                            value="123-456-7890"
                        />
                    </div>
                    <div class="setting-group">
                        <label for="password">Change Password:</label>
                        <input
                            type="password"
                            id="password"
                            name="password"
                            placeholder="Enter new password"
                        />
                    </div>
                </form>
            </section>
            <section class="settings-section">
                <h2>Child Information</h2>
                <form id="child-info-form">
                    <div class="setting-group">
                        <label for="child-name">Child's Name:</label>
                        <input
                            type="text"
                            id="child-name"
                            name="child-name"
                            value="Child's Name"
                        />
                    </div>
                    <div class="setting-group">
                        <label for="child-age">Child's Age:</label>
                        <input
                            type="number"
                            id="child-age"
                            name="child-age"
                            value="5"
                        />
                    </div>
                </form>
            </section>
            <section class="settings-section">
                <h2>Notification Preferences</h2>
                <form id="notification-settings-form">
                    <div class="setting-group">
                        <label for="notifications">
                            Receive Notifications:
                        </label>
                        <select id="notifications" name="notifications">
                            <option value="email">Email</option>
                            <option value="sms">SMS</option>
                            <option value="both">Both</option>
                            <option value="none">None</option>
                        </select>
                    </div>
                </form>
            </section>
            <section class="settings-section">
                <h2>Security Settings</h2>
                <form id="security-settings-form">
                    <div class="setting-group">
                        <label for="two-factor-auth">
                            Two-Factor Authentication:
                        </label>
                        <select id="two-factor-auth" name="two-factor-auth">
                            <option value="enabled">Enabled</option>
                            <option value="disabled">Disabled</option>
                        </select>
                    </div>
                </form>
            </section>

            <button type="submit" class="save-button">
                Save Changes
            </button>
            <p id="confirmation-message" class="confirmation-message"></p>
        </div>
    );
};

export default Settings;
